'use strict';

angular.module('parkLocator').factory('amenitiesService', ['$http', 
	function($http){
	
	var list = { content: [], uniques: [], activitiesPos: { markers: [] } };
	var selectedActivities = { current: [] };

	list.activitiesPos.markersConfig = {
    type: 'cluster',
    typeOptions: {
      title: 'Zoom in to find more activities!',
      gridSize: 60,
      minimumClusterSize: 8
    },
    typeEvents: {},
    control: {},
    options: 'options',
    icon: 'icon'
  };

  var activityWindow = {
  	show: false,
    coords: {},
    templateUrl: 'views/partials/activity-window.html',
    templateParameter: {},
    control: {},
    options: {
    	visible: true,
    	isHidden: true,
    	maxWidth: 150,
    	pixelOffset: { width: 0, height: -25 }
    }
  };

	var logAjaxError = function (error) {
		console.log(error);
	};

	var generateList = function (response) {

		if (typeof response.data === 'object') {
			var allAmenities = response.data.drawingInfo.renderer.uniqueValueInfos;
			allAmenities.forEach( function(amenity) {
				var processed = {
					id: amenity.value,
					name: amenity.label,
					url: amenity.symbol.url,
					imageData: amenity.symbol.imageData
				};

				list.content.push(processed);
			});
			
		} else {
			console.log('error', response);
		}

	};

	var _processUniques = function () {
		for (var i = 0; i < list.content.length; i++) {
			// Shorthand for current array element (current amenity)
			var c = list.content[i];

			// Name overrides
			if (c.name === 'Tennis') { c.name = 'Tennis Courts'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Theatre') { c.name = 'Theater'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Tennis Center') { c.imageDataLg = ''; c.imageDataSm = ''; c.imageData = ''; }
			if (c.name === 'Aquatic Center') { c.id = 1302; c.name = 'Pool'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Bocceball') { c.name = 'Bocce'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Off Leash Dog Area') { c.name = 'Dog Park'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Informal Playfield' || c.name === 'Multipurpose') { c.name = 'Multipurpose Field'; c.imageDataLg = ''; c.imageDataSm = ''; }

			// Mapping the amenity by id so we can get the name later when we have foreign keys
			list[c.id] = c;

			if (list[c.name]) {continue;}

			// Mapping the amenity by name so we know we've processed it
			list[c.name] = c;
			list.uniques.push(c);
		}
	};

	var _addMissingAmenities = function () {
		var missing = [
			{ name: 'Active Adult Center', imageDataLg: '', imageDataSm: '', imageData: ''},
			{ name: 'BMX Track', imageDataLg: '', imageDataSm: '', imageData: ''},
			{ name: 'Boat Rentals', imageDataLg: '', imageDataSm: '', imageData: '' },
			{ name: 'Environmental Education', id: 1307, imageData: '' },
			{ name: 'Greenway Trail', imageData: '' },
			{ name: 'Gym', imageDataLg: '', imageDataSm: '', imageData: '' },
			{ name: 'Kiddie Boats', imageDataLg: '', imageDataSm: '', imageData: '' },
			{ name: 'Library', imageDataLg: '', imageDataSm: '', imageData: '' },
			{ name: 'Museum', imageDataLg: '', imageDataSm: '', imageData: '' },
			{ name: 'Teen Center', imageDataLg: '', imageDataSm: '', imageData: '' },
			{ name: 'Walking Trails', imageDataLg: '', imageDataSm: '', imageData: '' },
		];
		
		for (var i = 0; i < missing.length; i++) {
			list.uniques.push(missing[i]);
			list[missing[i].name] = missing[i];
		}
		
		list[1307] = missing[3];
		list[2113] = { id: 2113, name: 'Youth Baseball', imageDataSm: '', imageDataLg: '', imageData: '' };
	};

	var _addParkAttributesName = function () {
		var rridx;
		for (var mm = 0; mm < list.uniques.length; mm++) {

			var c = list.uniques[mm];
			
			c.parkAttr = c.name.replace( /\s+/g, '').toUpperCase();
			
			if (c.name === 'Amusement Train') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Art Center') { c.parkAttr = 'ARTSCENTER'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Boat Ramp') { c.parkAttr = 'BOATRENTALS'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Kiddie Boats') { c.parkAttr = 'BOATRIDE'; }
			if (c.name === 'Baseball' || c.name === 'Softball' ) { c.parkAttr = 'BALLFIELDS'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Canoe Launch') { c.parkAttr = 'CANOE'; c.imageDataSm = ''; c.imageDataLg = ''; }
			if (c.name === 'Fishing Area') { c.parkAttr = 'FISHING'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Horseshoe Pit') { c.parkAttr = 'HORSESHOE'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'In Line Hockey') { c.parkAttr = 'INLINESKATING'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Active Adult Center') { c.parkAttr = 'ACTIVE_ADULT'; }
			if (c.name === 'Environmental Education') { c.parkAttr = 'ENVCTR'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Greenway Trail') { c.parkAttr = 'GREENWAYACCESS'; c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Teen Center') { c.parkAttr = 'TEEN'; }

			// Add better icons in base 64
			if (c.name === 'Carousel') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Community Center') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Disc Golf') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Handball') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Neighborhood Center') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Outdoor Basketball') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Picnic Shelter') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Playground') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Sand Volleyball') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Skate Park') { c.imageDataLg = ''; c.imageDataSm = ''; }
			if (c.name === 'Track') { c.imageDataLg = ''; c.imageDataSm = ''; }


			// No parks can be searched by restroom
			if (c.name === 'Restroom') { rridx = mm; c.imageDataSm = ''; c.imageDataLg = ''; }
			
		}

		list[1301] = list.Pool;
		list[1311] = list['Neighborhood Center'];
		list[2203] = list['Canoe Launch'];
		list[2302] = list['Outdoor Basketball'];
		list[2307] = list['Sand Volleyball'];
		list.uniques.splice(rridx, 1);

	};

	var updateActivityWindow = function (activityMarker) {
		console.log(activityMarker);
    console.log(activityWindow);
    activityWindow.show = true;
    activityWindow.coords = { latitude: activityMarker.latitude, longitude: activityMarker.longitude };
    activityWindow.templateParameter = { name: activityMarker.name, park: activityMarker.park, subcategoryName: activityMarker.subcategory.name };
    // activityWindow.control.showWindow();
	};


	var getAmenitiesData = function () {
		// First set of amenities (buildings)
		return $http({
			method: 'GET',
			url: 'https://maps.raleighnc.gov/arcgis/rest/services/Parks/ParkLocator/MapServer/2?f=pjson'
		});
	};

	var getAmenitiesData2 = function () {
		// Second set of amenities (outdoors)
		return $http({
			method: 'GET',
			url: 'https://maps.raleighnc.gov/arcgis/rest/services/Parks/ParkLocator/MapServer/3?f=pjson'
		});
	};

	var completeData = function () {
		_processUniques();
		_addMissingAmenities();
		_addParkAttributesName();
	};

	var getJoinParkData = function () {
		// Building amenities join table with parks
		return $http({
			method: 'GET',
			url: 'https://maps.raleighnc.gov/arcgis/rest/services/Parks/ParkLocator/MapServer/2/query?where=1%3D1&text=&objectIds=&time=&geometry=&geometryType=esriGeometryEnvelope&inSR=&spatialRel=esriSpatialRelIntersects&relationParam=&outFields=*&returnGeometry=true&returnTrueCurves=false&maxAllowableOffset=&geometryPrecision=&outSR=4326&returnIdsOnly=false&returnCountOnly=false&orderByFields=&groupByFieldsForStatistics=&outStatistics=&returnZ=false&returnM=false&gdbVersion=&returnDistinctValues=false&resultOffset=&resultRecordCount=&f=pjson'
		});
	};

	var getJoinParkData2 = function () {
		// Outdoor amenities join table with parks
		return $http({
			method: 'GET',
			url: 'https://maps.raleighnc.gov/arcgis/rest/services/Parks/ParkLocator/MapServer/3/query?where=1%3D1&text=&objectIds=&time=&geometry=&geometryType=esriGeometryEnvelope&inSR=&spatialRel=esriSpatialRelIntersects&relationParam=&outFields=*&returnGeometry=true&returnTrueCurves=false&maxAllowableOffset=&geometryPrecision=&outSR=4326&returnIdsOnly=false&returnCountOnly=false&orderByFields=&groupByFieldsForStatistics=&outStatistics=&returnZ=false&returnM=false&gdbVersion=&returnDistinctValues=false&resultOffset=&resultRecordCount=&f=pjson'
		});
	};


	return {
		list: list,
		selectedActivities: selectedActivities,
		activityWindow: activityWindow,
		getAmenitiesData: getAmenitiesData,
		getAmenitiesData2: getAmenitiesData2,
		completeData: completeData,
		logAjaxError: logAjaxError,
		generateList: generateList,
		getJoinParkData: getJoinParkData,
		getJoinParkData2: getJoinParkData2,
		updateActivityWindow: updateActivityWindow
	};
}]);